import './App.css'
 import {
  BrowserRouter,
   Link,
   Switch,
   Route
 } from '';

import Login from './login.js'
import Home from './home.js'

function App()
{
  return(
    <div className="App">
      <BrowserRouter>
      <div>
            <Link to="/login">LOGIN</Link>
            <Link to="/home">Home</Link>
      </div>
      <Switch>
        <Route path="/login"><Login /></Route>
        <Route path="/home"><Home /></Route>
      </Switch>


      </BrowserRouter>
    </div>
  )
}

export default App;
